import React from 'react';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
function PersonalInfo() {

  return (
   //  {type:
   //  amount:
   // quantity}
    <React.Fragment>
      <Typography variant="h6" gutterBottom>
        Add your coins
      </Typography>
      <Grid container spacing={24}>
      <Grid item xs={8} sm={3}>
      <InputLabel htmlFor="coin">Coin Type</InputLabel>
        <Select
          value='{this.state.age}'
          inputProps={{
            name: 'coin',
            id: 'coin-simple',
          }}
        >
          // <MenuItem value="">
          //   <em>None</em>
          </MenuItem>
          <MenuItem value={10}>BTC</MenuItem>
          <MenuItem value={20}>ETH</MenuItem>
          <MenuItem value={30}>XRP</MenuItem>
        </Select>
      </Grid>
        <Grid item xs={8} sm={3}>
          <TextField required id="coinAmount" label="Coin Amount" fullWidth />
        </Grid>

        <Grid item xs={8} sm={3}>
          <TextField required id="coinPrice" label="Price per unit" fullWidth />
        </Grid>
      </Grid>
    </React.Fragment>
  );
}

export default PersonalInfo;
